import React from "react";
import classes from "./Header.module.css";

import Button from "../UI/Button/Button";

const Header = (props) => {
 
  return (
    <div className={classes.header}>
      <div className={classes["search-header"]}>
        <Button key = 'kpop' id = 'kpop' name = 'K-pop' className={classes['kpop-button']}/>
        <Button key = 'openings' id = 'openings' name = 'Openings'className={classes['opening-button']} />
        <Button  key = 'jpop' id = 'jpop' name = 'J-pop' className={classes['jpop-button']}/>
        <Button key = 'videogames' id = 'kpop' name = 'Videogames' className={classes['videogames-button']} />
      </div>
      <div className={classes["user-header"]}>
        <Button className={classes['help-button']}/>
        <Button className={classes['help-button']}/>
      </div>
    </div>
  );
};

export default Header;
